import Input from "./Input"
import Button from "./Button.js"

function AuthModal() {
    return (
        <div className="w-screen h-screen fixed top-0 left-0 z-20 flex" style={{backgroundColor:'rgba(0,0,0,.6)'}}>
            <div className="border border-gray-700 w-full bg-biome_dark p-5 text-biome_text mx-4 flex self-center">
                <h1 className="text-2xl mb-3">Login</h1>
                    <Input type="text" className="mb-2"/>
                    <Input type ="password" className="mb-2"/>
                    <Button className="w-full"> </Button>
            </div>
        </div>  
    );
}
export default AuthModal;
